import React from 'react'

function Inputs({plus, any}) {
    return (
        <div className={styles.inputContainer}>
            <input type='button' value='<<' onClick={()=>any()}/>

            <input type='button' value='>>' onClick={()=>plus()}/>    
        </div>
    )
}

export default Inputs
